const fetch = require("node-fetch");
const { cmd } = require("../command");

const more = String.fromCharCode(8206);
const readMore = more.repeat(4001);

cmd({
    pattern: "script",
    alias: ["repo", "sc", "info"],
    desc: "Fetch information about a GitHub repository.",
    react: "🎗️",
    category: "info",
    filename: __filename,
}, async (conn, mek, m, { from }) => {
    const githubRepoURL = "https://github.com/Jeffreyfx1/jfx-md-x-v3";

    try {
        // Extract username and repo name
        const [, username, repoName] =
            githubRepoURL.match(/github\.com\/([^/]+)\/([^/]+)/) || [];
        if (!username || !repoName) throw new Error("Invalid GitHub URL format");

        // Fetch repo details
        const response = await fetch(
            `https://api.github.com/repos/${username}/${repoName}`
        );
        if (!response.ok)
            throw new Error(
                `GitHub API request failed with status ${response.status}`
            );
        const repoData = await response.json();

        // Format info
        const status = `
*𝐇𝐄𝐋𝐋𝐎 𝐓𝐇𝐄𝐑𝐄* 
──────────────────
${readMore}
\`BOT NAME:\`
> ${repoData.name}

\`OWNER NAME:\`
> ${repoData.owner.login}

\`STARS:\`
> ${repoData.stargazers_count}

\`FORKS:\`
> ${repoData.forks_count}

\`REPO LINK:\`
> ${githubRepoURL}
──────────────────
\n> *© ʙʏ ᴊᴇᴘʜᴛᴇʀ ᴛᴇᴄʜ* 🎐`;

        // Contact message for verified context
        const verifiedContact = {
            key: {
                fromMe: false,
                participant: `0@s.whatsapp.net`,
                remoteJid: "status@broadcast"
            },
            message: {
                contactMessage: {
                    displayName: "ᴊꜰx ᴍᴅ-xᴠ3",
                    vcard: "BEGIN:VCARD\nVERSION:3.0\nFN: ᴊᴇᴘʜᴛᴇʀ ᴛᴇᴄʜ\nORG:ᴊꜰx ᴍᴅ-xᴠ3;\nTEL;type=CELL;type=VOICE;waid=93775551335:+2349046157539\nEND:VCARD"
                }
            }
        };

        // Send image + repo info
        await conn.sendMessage(from, { 
            image: { url: `https://files.catbox.moe/7kl8va.jpg` },  
            caption: status,
            contextInfo: {
                mentionedJid: [m.sender],
                forwardingScore: 999,
                isForwarded: true,
                forwardedNewsletterMessageInfo: {
                    newsletterJid: '120363420646690174@newsletter',
                    newsletterName: 'ᴊꜰx ᴍᴅ-xᴠ3',
                    serverMessageId: 143
                }
            }
        }, { quoted: verifiedContact });

        // Send audio inside same verified context
        await conn.sendMessage(from, { 
            audio: { url: 'https://files.catbox.moe/eqfc2j.mp3' },
            mimetype: 'audio/mp4',
            ptt: true 
        }, { quoted: verifiedContact });

    } catch (error) {
        console.error("Error in script command:", error);
        await conn.sendMessage(from, { text: "❌ Failed to fetch repo info." });
    }
});
